import{o as a,c as n,d as t}from"./app.fc5f256e.js";const s='{"title":"Markdown语法","description":"","frontmatter":{},"headers":[{"level":2,"title":"一、常用选项","slug":"一、常用选项"},{"level":2,"title":"二、待办事项","slug":"二、待办事项"},{"level":2,"title":"三、插入表格","slug":"三、插入表格"},{"level":2,"title":"四、插入图表chart","slug":"四、插入图表chart"}],"relativePath":"src\\\\frontend\\\\other-note\\\\Markdown语法.md","lastUpdated":1612101737389}',p={},e=t('<h1 id="markdown语法"><a class="header-anchor" href="#markdown语法" aria-hidden="true">#</a> Markdown语法</h1><h2 id="一、常用选项"><a class="header-anchor" href="#一、常用选项" aria-hidden="true">#</a> 一、常用选项</h2><ol><li><p><strong>标题：</strong> 一个<code>#</code>代表一级标题，等同于h1~h6</p></li><li><p>加粗文本：*<em>印象笔记</em>*</p></li><li><p>斜体：*印象*</p></li><li><p>引用文本：&gt;</p></li><li><p>高亮：`高亮文本`</p></li><li><p>标记：==文本==</p></li><li><p>列表：</p><ul><li>无序列表：*、+、-</li><li>有序列表：1.空格</li></ul></li><li><p>下划线：&lt;u&gt;印象&lt;/u&gt;</p></li><li><p>添加颜色和字体大小：<code>&lt;font color=red size=18&gt;哈哈&lt;/font&gt;</code></p></li><li><p>上标：&lt;sup&gt;</p></li><li><p>下标：&lt;sub&gt;</p></li><li><p>删除线：~~印象~~</p></li><li><p>分隔线：***或---</p></li><li><p>插入行内代码或代码块：```语言</p></li><li><p>插入链接：[百度](<a href="http://www.baidu.com" target="_blank" rel="noopener noreferrer">www.baidu.com</a>)</p></li><li><p>插入图片：![image](地址) 支持网络图片</p><p>本地图片控制大小：图片名@w=300h=200</p></li><li><p>插入数字公式：```math</p></li><li><p>设置目录：[TOC]</p></li><li><p>空格：</p><p>半方大的空白：&amp;ensp;或&amp;#8194;</p><p>全方大的空白：&amp;emsp;或&amp;#8195;</p><p>不断行的空白：&amp;nbsp;或&amp;#160;</p></li><li><p>脚注：</p><p>[^自定义变量]</p></li></ol><div class="language-markdown"><pre><code>生成一个脚注1[^footnote]. \n<span class="token url-reference url"><span class="token punctuation">[</span><span class="token variable">^footnote</span><span class="token punctuation">]</span><span class="token punctuation">:</span> 这里是</span> <span class="token bold"><span class="token punctuation">**</span><span class="token content">脚注</span><span class="token punctuation">**</span></span> 的 <span class="token italic"><span class="token punctuation">*</span><span class="token content">内容</span><span class="token punctuation">*</span></span>. \n生成一个脚注2[^foot]. \n[^foot]:这里是<span class="token bold"><span class="token punctuation">**</span><span class="token content">脚注2</span><span class="token punctuation">**</span></span>的<span class="token italic"><span class="token punctuation">*</span><span class="token content">内容</span><span class="token punctuation">*</span></span>.\n</code></pre></div><h2 id="二、待办事项"><a class="header-anchor" href="#二、待办事项" aria-hidden="true">#</a> 二、待办事项</h2><p>*[ ] 第一只青蛙</p><h2 id="三、插入表格"><a class="header-anchor" href="#三、插入表格" aria-hidden="true">#</a> 三、插入表格</h2><ul><li>使用|符号，---来区分标题</li></ul><div class="language-markdown"><pre><code><span class="token table"><span class="token table-header-row"><span class="token punctuation">|</span><span class="token table-header important"> 帐户类型 </span><span class="token punctuation">|</span><span class="token table-header important"> 免费帐户 </span><span class="token punctuation">|</span><span class="token table-header important"> 标准帐户 </span><span class="token punctuation">|</span><span class="token table-header important"> 高级帐户 </span><span class="token punctuation">|</span>\n</span><span class="token table-line"><span class="token punctuation">|</span> <span class="token punctuation">---</span> <span class="token punctuation">|</span> <span class="token punctuation">---</span> <span class="token punctuation">|</span> <span class="token punctuation">---</span> <span class="token punctuation">|</span> <span class="token punctuation">---</span> <span class="token punctuation">|</span>\n</span><span class="token table-data-rows"><span class="token punctuation">|</span><span class="token table-data"> 帐户流量 </span><span class="token punctuation">|</span><span class="token table-data"> 60M </span><span class="token punctuation">|</span><span class="token table-data"> 1GB </span><span class="token punctuation">|</span><span class="token table-data"> 10GB </span><span class="token punctuation">|</span>\n<span class="token punctuation">|</span><span class="token table-data"> 设备数目 </span><span class="token punctuation">|</span><span class="token table-data"> 2台 </span><span class="token punctuation">|</span><span class="token table-data"> 无限制 </span><span class="token punctuation">|</span><span class="token table-data"> 无限制 </span><span class="token punctuation">|</span>\n<span class="token punctuation">|</span><span class="token table-data"> 当前价格 </span><span class="token punctuation">|</span><span class="token table-data"> 免费 </span><span class="token punctuation">|</span><span class="token table-data"> ￥8.17/月 </span><span class="token punctuation">|</span><span class="token table-data"> ￥12.33/月</span><span class="token punctuation">|</span>\n</span></span></code></pre></div><table><thead><tr><th>帐户类型</th><th>免费帐户</th><th>标准帐户</th><th>高级帐户</th></tr></thead><tbody><tr><td>帐户流量</td><td>60M</td><td>1GB</td><td>10GB</td></tr><tr><td>设备数目</td><td>2台</td><td>无限制</td><td>无限制</td></tr><tr><td>当前价格</td><td>免费</td><td>￥8.17/月</td><td>￥12.33/月</td></tr></tbody></table><h2 id="四、插入图表chart"><a class="header-anchor" href="#四、插入图表chart" aria-hidden="true">#</a> 四、插入图表chart</h2><div class="language-markdown"><pre><code>​```chart\n,预算,收入,花费,债务\nJune,5000,8000,4000,6000\nJuly,3000,1000,4000,3000\nAug,5000,7000,6000,3000\nSep,7000,2000,3000,1000\nOct,6000,5000,4000,2000\nNov,4000,3000,5000,\n\ntype: pie\ntitle: 每月收益\nx.title: Amount\ny.title: Month\ny.suffix: $\n​```\n</code></pre></div><ul><li>更多语法百度查看</li></ul>',13);p.render=function(t,s,p,l,o,c){return a(),n("div",null,[e])};export default p;export{s as __pageData};
